import React from "react";

function EmployeeCard(props) {
    return (

        <div key={props.email} className = "employee-info card employees">
            <div className="images">
                <img src={props.image}></img>
            </div>
            <div className="title-name">
                {props.title} 
                {props.first} 
                {props.last}
            </div>
            <div className="age">
                {props.age}
            </div>
            <div className="phone">
                {props.phone}
            </div>
            <div className="email">
                {props.email}
            </div>
        </div>
  

    );
};

export default EmployeeCard;
